import React from "react";
import { AppBar, Toolbar, Typography, IconButton, Box, Button } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import CakeIcon from "@mui/icons-material/Cake";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <AppBar position="sticky" sx={{ background: "#ffebf0", borderBottom: "2px solid #ffd1dc" }}>
      <Toolbar sx={{ display: "flex", justifyContent: "space-between" }}>
        <Box display="flex" alignItems="center">
          <CakeIcon sx={{ color: "#ff4f7b", fontSize: 32, mr: 1 }} />
          <Typography component={Link} to="/" sx={{ textDecoration: "none", color: "#ff4f7b", fontWeight: "bold", fontFamily: "cursive" }}>
            SweetCraft
          </Typography>
        </Box>
        <Box>
          {["bento-cakes","pastries","waffles","pancakes"].map(cat => (
            <Button key={cat} component={Link} to={`/category/${cat}`} sx={{ mx: 1, color: "#d6336c", background: "#ffe6ea", "&:hover": { background: "#ffd6df" } }}>
              {cat.replace("-", " ")}
            </Button>
          ))}
        </Box>
        <IconButton component={Link} to="/cart" sx={{ color: "#ff4f7b" }}>
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
